import React, {Component} from "react";
import "./city.scss";


class City extends Component {
    render() {
        let style = {
            position: "absolute",
            left: this.props.left,
            top: this.props.top
        };
        return (
                <div className="object-city" style={style}>{this.props.name}
                <div className="autokar-wrapper">
                    <img className="autokar-front-icon" src={require("./img/autokar-front.png")} alt="autokar-front"/>
                </div>
                </div>
        )
    }
}

export default City;
